import React from 'react';
import { Link } from 'react-router-dom';

export default function Navbar() {
  return (
    <div>

        <nav className="navbar navbar-expand-lg bg-primary">
        <div class="collapse navbar-collapse" id="navbarSupportedContent">
            <Link className="btn btn-outline-light me-1 mx-auto" to="/">Home</Link>
            <Link className="btn btn-outline-light me-1" to="/add-task">Archive</Link>
            <Link className="btn btn-outline-light me-1" to="/add-task">Add task</Link>
        </div>
        </nav>

    </div>
  )
}
